import{_ as e,o as a,c as t,e as r}from"./app-bbb313f6.js";const o={},n=r('<h1 id="types-project-rundown" tabindex="-1"><a class="header-anchor" href="#types-project-rundown" aria-hidden="true">#</a> Types project rundown</h1><h2 id="streamcompaniontypes-datatypes" tabindex="-1"><a class="header-anchor" href="#streamcompaniontypes-datatypes" aria-hidden="true">#</a> StreamCompanionTypes.DataTypes</h2><p>Contains all base types used by StreamCompanion.</p><h3 id="tokens" tabindex="-1"><a class="header-anchor" href="#tokens" aria-hidden="true">#</a> <code>Tokens</code></h3><p>Maybe most important of all these, this is central storage class for all tokens in StreamCompanion.<br> Tokens from other plugins can be accessed there from <code>AllTokens</code> prop.<br> Use <code>Tokens.CreateTokenSetter(pluginName)</code> to create method for creating and updating tokens.<br> Tokens can be lazily-created by providing values as <code>Lazy&lt;object&gt;</code>.</p><h3 id="beatmap" tabindex="-1"><a class="header-anchor" href="#beatmap" aria-hidden="true">#</a> <code>Beatmap</code></h3><p>Contains most of beatmap-related data. Only thing to note here is that not all props will be filled, notably:</p><ul><li>mapId/mapSetId - these are not provided in old osu diff files(2007~2009?), and should be retrieved using <code>mapid</code> and <code>mapsetid</code> tokens.</li><li>State - map ranked status, not stored at all in osu diff files, use <code>rankedStatus</code> token.</li><li>StarRating - star rating values will be provided only for nomod and currently selected mod combination, in current play mode.</li></ul><h3 id="configentry" tabindex="-1"><a class="header-anchor" href="#configentry" aria-hidden="true">#</a> <code>ConfigEntry</code></h3><p>Small class for defining key/value setting pairs.<br> Creating an instance of this class by itself does nothing. To save your default setting in file you should access it via <code>ISettings</code>, by either getting its value <code>ISettings.Get&lt;T&gt;(configEntry)</code> or modifying it <code>ISettings.Add(settingKey, settingValue)</code>.</p><h3 id="mapsearchargs" tabindex="-1"><a class="header-anchor" href="#mapsearchargs" aria-hidden="true">#</a> <code>MapSearchArgs</code></h3><p>Arguments which are/were used for finding current beatmap data.</p><h3 id="mapsearchresult" tabindex="-1"><a class="header-anchor" href="#mapsearchresult" aria-hidden="true">#</a> <code>MapSearchResult</code></h3><p>&quot;Final&quot; search object that gets dispatched to consumer plugins. Most important props:</p><ul><li><code>BeatmapsFound</code> - array of beatmap objects returned from search. This is somewhat relic of the past - currently array will contain either 0 or 1 map (in the MSN-based searcher days it used to return multiple, hence the array).</li><li><code>Mods</code> - Raw mods as well as its string representation for user and processing.</li><li><code>Action</code> - What was osu! doing when this event was invoked. (Playing/Watching/Listening...)</li><li><code>PlayMode</code> - What play mode was selected in the song selection screen in osu!.</li><li><code>SharedObjects</code> - Misc objects shared between core plugins.</li></ul><h2 id="streamcompaniontypes-interfaces" tabindex="-1"><a class="header-anchor" href="#streamcompaniontypes-interfaces" aria-hidden="true">#</a> StreamCompanionTypes.Interfaces</h2><h3 id="iplugin" tabindex="-1"><a class="header-anchor" href="#iplugin" aria-hidden="true">#</a> <code>IPlugin</code></h3><p>Base marker interface indicating that current class is an entry point of a StreamCompanion plugin. One assembly can contain multiple of these.</p><h3 id="imapdatafinder" tabindex="-1"><a class="header-anchor" href="#imapdatafinder" aria-hidden="true">#</a> <code>IMapDataFinder</code></h3><p>Provides a method for searching beatmap data based on data inside <code>MapSearchArgs</code>. Finders will be executed in order, based on <code>Priority</code>.</p><h3 id="ifirstruncontrol-ifirstruncontrolprovider" tabindex="-1"><a class="header-anchor" href="#ifirstruncontrol-ifirstruncontrolprovider" aria-hidden="true">#</a> <code>IFirstRunControl</code> &amp; <code>IFirstRunControlProvider</code></h3><p>Used for creating StreamCompanion first run steps.</p><h2 id="streamcompaniontypes-interfaces-consumers" tabindex="-1"><a class="header-anchor" href="#streamcompaniontypes-interfaces-consumers" aria-hidden="true">#</a> StreamCompanionTypes.Interfaces.Consumers</h2><h3 id="imapdataconsumer" tabindex="-1"><a class="header-anchor" href="#imapdataconsumer" aria-hidden="true">#</a> <code>IMapDataConsumer</code></h3><p>Provides a method/hook for executing any plugin-specific actions at the end of events. Map data, all tokens &amp; output patterns are created/lazily-created, and can be freely consumed.</p><h3 id="ihighfrequencydataconsumer" tabindex="-1"><a class="header-anchor" href="#ihighfrequencydataconsumer" aria-hidden="true">#</a> <code>IHighFrequencyDataConsumer</code></h3><p>Used for passing frequently updating(live tokens) data around.<br> This one can be both implemented if you want to add another output source, and consumed (as <code>IList&lt;IHighFrequencyDataConsumer&gt;</code>) if you need to send data.<br> Data is sent via MMF(Memory-mapped files), TCP(when enabled in settings) &amp; web socket output patterns endpoint.</p><h2 id="streamcompaniontypes-interfaces-sources" tabindex="-1"><a class="header-anchor" href="#streamcompaniontypes-interfaces-sources" aria-hidden="true">#</a> StreamCompanionTypes.Interfaces.Sources</h2><h3 id="itokenssource" tabindex="-1"><a class="header-anchor" href="#itokenssource" aria-hidden="true">#</a> <code>ITokensSource</code></h3><p>Provides a method in which you should do all logic related to creating or updating non-live tokens for current map search results.</p><h3 id="iosueventsource" tabindex="-1"><a class="header-anchor" href="#iosueventsource" aria-hidden="true">#</a> <code>IOsuEventSource</code></h3><p>Provides an event which should get fired whenever your plugin detects new actions in osu!. There should be no cases where you should be using this, unless you are implementing new osu! event source (osu!lazer? ðŸ‘€)</p><h3 id="ioutputpatternsource" tabindex="-1"><a class="header-anchor" href="#ioutputpatternsource" aria-hidden="true">#</a> <code>IOutputPatternSource</code></h3><p>Provides a method for creating output patterns. At that point map data and all tokens for current event are updated and can be used.</p><h3 id="isettingssource" tabindex="-1"><a class="header-anchor" href="#isettingssource" aria-hidden="true">#</a> <code>ISettingsSource</code></h3><p>Provides a way of creating settings GUI.<br> Object returned from <code>GetUiSettings()</code> should be a winForm <code>UserControl</code>.</p><h2 id="streamcompaniontypes-interfaces-services" tabindex="-1"><a class="header-anchor" href="#streamcompaniontypes-interfaces-services" aria-hidden="true">#</a> StreamCompanionTypes.Interfaces.Services</h2><p>Implementations for these interfaces are provided by StreamCompanion, and can be retrieved by specifying these in your plugin constructor.</p><h3 id="imodparser" tabindex="-1"><a class="header-anchor" href="#imodparser" aria-hidden="true">#</a> <code>IModParser</code></h3><p>Mods converting utils.</p><h3 id="isaver" tabindex="-1"><a class="header-anchor" href="#isaver" aria-hidden="true">#</a> <code>ISaver</code></h3><p>Save data in text files. Also provides <code>SaveDirectory</code> where custom files should be saved - create directory inside if needed.</p><h3 id="isettings" tabindex="-1"><a class="header-anchor" href="#isettings" aria-hidden="true">#</a> <code>ISettings</code></h3><p>Used to retrieve and store user settings.</p><h3 id="ilogger-icontextawarelogger" tabindex="-1"><a class="header-anchor" href="#ilogger-icontextawarelogger" aria-hidden="true">#</a> <code>ILogger</code> &amp; <code>IContextAwareLogger</code></h3><p>Basic level-based logger. Context data set in <code>IContextAwareLogger.SetContextData</code> is logged with thrown or logged exceptions.</p><h3 id="idifficultycalculator" tabindex="-1"><a class="header-anchor" href="#idifficultycalculator" aria-hidden="true">#</a> <code>IDifficultyCalculator</code></h3><p>Utility class for calculating basic map stats changes based on mods.</p><h3 id="delegates" tabindex="-1"><a class="header-anchor" href="#delegates" aria-hidden="true">#</a> <code>Delegates</code></h3><p>Safe way to shutdown or restart StreamCompanion via method call. Request individual methods in your plugin constructor.</p><h3 id="imapdatasaver-idatabasecontroller" tabindex="-1"><a class="header-anchor" href="#imapdatasaver-idatabasecontroller" aria-hidden="true">#</a> <code>IMapDataSaver</code> &amp; <code>IDatabaseController</code></h3><p><strong>Not used anymore, will be removed in future versions</strong>. Was used to store beatmaps loaded from osu! database file in local, easily searchable database.</p><h3 id="imainwindowmodel" tabindex="-1"><a class="header-anchor" href="#imainwindowmodel" aria-hidden="true">#</a> <code>IMainWindowModel</code></h3><p><strong>Will be removed in future versions</strong>. StreamCompanion main window specific interface used for updating data.</p>',54),i=[n];function s(d,c){return a(),t("div",null,i)}const l=e(o,[["render",s],["__file","types-rundown.html.vue"]]);export{l as default};
